import React, { Component } from 'react';
var $  = require( 'jquery' );

class HomeOne extends Component {
  constructor(props) {
    super(props);
    this.myRef = this.DataTable();

  }


  componentDidMount() {
    $(function(){
      $('#myTable').DataTable();
    });
}
render() {
    return (
        <div className="wrapper">
            <div ref={(ref) => this.mtTable = ref}> </div>
        </div>);
}
}

export default HomeOne;
